      style={{
        marginLeft: 10
      }}
    >
      <File
        style={style}
        name={name}
        file={{}}
      />
      {Object.entries(file).map(([key, value]) => {
        console.log(key, value)
        if(key === `type`) {
          return
        }
        return <File
          file={value}
          name={key}
          key={key}
        />
      })}
    </div> : <>
      {name}
    </> }
  </div>
}
